import React from "react";
import {
  View,
  Text,
  Button,
  TouchableOpacity,
  Dimensions,
  TextInput,
  SafeAreaView,
  Platform,
  StyleSheet,
} from "react-native";

export default function Login() {
  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.header}></View>
      <View style={styles.footer}></View>
    </SafeAreaView>
  );
}
